module.exports = "<link\r\n  rel=\"stylesheet\"\r\n  href=\"https://use.fontawesome.com/releases/v5.6.1/css/all.css\"\r\n  integrity=\"sha384-gfdkjb5BdAXd+lj+gudLWI+BXq4IuLW5IT+brZEZsLFm++aCMlF1V92rMkPaX4PP\"\r\n  crossorigin=\"anonymous\"\r\n/>\r\n<!-- Header Banner -->\r\n<section id=\"header-bannerId\">\r\n  <div class=\"header-banner-coontainer\">\r\n    <div class=\"container\">\r\n      <h3>OUR VISION</h3>\r\n      <!-- <p>\r\n        We founded partbnb to enable everyone to enjoy in the huge benefits of\r\n        owning a vacation rental property. We believe that everyone should have\r\n        access to this market, regardless of the amount that they will have to\r\n        invest. We love tthe locations where we buy property, and know that you\r\n        will too. We hope our owners will make use of the ability to use the\r\n        properties at a discounted rate, and get that feeling that we do of\r\n        pride in every property owned.\r\n      </p> -->\r\n      <p>Founded in October 2018 - we started Partbnb to enable Investors to share in the many benefits of owning a Vacation Rental property without the high upfront financial / time commitments.</p>\r\n      <p>We believe that everyone should be able to diversify into this area of real estate investment, regardless of the amount that they have to invest. We love the locations where we buy property, and know that you will too. We hope our owners take the opportunity to go and check out the properties for themselves at a discounted rate.</p>\r\n      <p>Our long term vision is to continue to add properties in different locations around the Caribbean to offer investors a wide diversified portfolio opportunity.</p>\r\n    </div>\r\n  </div>\r\n</section>\r\n<!-- Header Banner end -->\r\n<!-- Content -->\r\n<section id=\"contentId\">\r\n  <div class=\"content-container\">\r\n    <div class=\"container\">\r\n      <div class=\"center-text\">\r\n        <h3 class=\"content-title\">Management Team</h3>\r\n      </div>\r\n      <div class=\"content\">\r\n        <div class=\"row mb-5\">\r\n          <div class=\"col-md-4\">\r\n            <div class=\"card h-100 border-0\">\r\n              <div class=\"card-body\">\r\n                <div class=\"center-text mb-4\">\r\n                  <img\r\n                    src=\"assets/about-us/James@2x.png\"\r\n                    alt=\"Card image cap\"\r\n                    class=\"image-size\"\r\n                  />\r\n                </div>\r\n                <div class=\"center-text\">\r\n                  <h3 class=\"content-card-title\">\r\n                    James Punnett <br />\r\n                    <span class=\"content-card-title-description\"\r\n                      >Founder & CEO</span\r\n                    >\r\n                  </h3>\r\n                </div>\r\n                <div class=\"member-bio\">\r\n                  <p class=\"card-text\">\r\n                    As a serial entrepreneur James has been involved in numerous\r\n                    startup businesses including founding LifeDirect, the\r\n                    largest online insurance marketplace in New Zealand. James\r\n                    started in the insurance space, but has spent the last 3\r\n                    years in the Real Estate / Lending sector delivering a new\r\n                    Fintech platform for the largest real estate businesses in\r\n                    Australia & New Zealand. <br /><br />\r\n                    In addition to this James has built a property portfolio of\r\n                    short term rental properties around New Zealand, and serves\r\n                    on various boards.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n              <!-- <div class=\"card-footer border-0\">\r\n                <div class=\"right-text\">\r\n                  <a\r\n                    (click)=\"toggleClass($event)\"\r\n                    href=\"javascript:void(0)\"\r\n                    class=\"read-more-paragraph\"\r\n                  >\r\n                    Read More <i class=\"fas fa-plus-circle\"></i>\r\n                  </a>\r\n                </div>\r\n              </div> -->\r\n            </div>\r\n          </div>\r\n          <div class=\"col-md-4\">\r\n            <div class=\"card h-100 border-0\">\r\n              <div class=\"card-body\">\r\n                <div class=\"center-text mb-4\">\r\n                  <img\r\n                    src=\"assets/about-us/Craig@2x.png\"\r\n                    alt=\"Card image cap\"\r\n                    class=\"image-size\"\r\n                  />\r\n                </div>\r\n                <div class=\"center-text\">\r\n                  <h3 class=\"content-card-title\">\r\n                    Craig Milligan <br />\r\n                    <span class=\"content-card-title-description\">\r\n                      Chief Propety Hunter\r\n                    </span>\r\n                  </h3>\r\n                </div>\r\n                <div class=\"member-bio\">\r\n                  <p class=\"card-text\">\r\n                    Craig is passionate about property and traveling the world\r\n                    and Partbnb embodies both of these ideas. He grew up in New\r\n                    Zealand, but has spent the past 10 years living overseas in\r\n                    the United Kingdom and Singapore. He has spent the past 18\r\n                    years working in the Information Technology space across a\r\n                    broad spectrum of industries and locations. <br /><br />\r\n                    Craig has also built a property portfolio of short term\r\n                    rental properties around New Zealand.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n              <!-- <div class=\"card-footer border-0\">\r\n                <div class=\"right-text\">\r\n                  <a\r\n                    (click)=\"toggleClass($event)\"\r\n                    href=\"javascript:void(0)\"\r\n                    class=\"read-more-paragraph\"\r\n                  >\r\n                    Read More <i class=\"fas fa-plus-circle\"></i>\r\n                  </a>\r\n                </div>\r\n              </div> -->\r\n            </div>\r\n          </div>\r\n          <div class=\"col-md-4\">\r\n            <div class=\"card h-100 border-0\">\r\n              <div class=\"card-body\">\r\n                <div class=\"center-text mb-4\">\r\n                  <img\r\n                    src=\"assets/about-us/Tom@2x.png\"\r\n                    alt=\"Card image cap\"\r\n                    class=\"image-size\"\r\n                  />\r\n                </div>\r\n                <div class=\"center-text\">\r\n                  <h3 class=\"content-card-title\">\r\n                    Tom Herbert <br />\r\n                    <span class=\"content-card-title-description\">\r\n                      Chief Technology Officer\r\n                    </span>\r\n                  </h3>\r\n                </div>\r\n                <div class=\"member-bio\">\r\n                  <p class=\"card-text\">\r\n                    Originally born in the UK, Tom grew up in the Cayman Islands\r\n                    and his first job at age 14 was building and selling\r\n                    computers. <br /><br />\r\n                    He returned to the UK and spent his twenties climbing the\r\n                    corporate ladder of insurance software development, before\r\n                    ultimately ditching the suit and tie in 2017 to form his own\r\n                    startup - BlackFin Technology - to focus on building cool\r\n                    tech like Partbnb.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n              <!-- <div class=\"card-footer border-0\">\r\n                <div class=\"right-text\">\r\n                  <a\r\n                    (click)=\"toggleClass($event)\"\r\n                    href=\"javascript:void(0)\"\r\n                    class=\"read-more-paragraph\"\r\n                  >\r\n                    Read More <i class=\"fas fa-plus-circle\"></i>\r\n                  </a>\r\n                </div>\r\n              </div> -->\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"row mb-5\">\r\n          <div class=\"col-md-4\">\r\n            <div class=\"card h-100 border-0\">\r\n              <div class=\"card-body\">\r\n                <div class=\"center-text mb-4\">\r\n                  <img\r\n                    src=\"assets/about-us/Amanda@2x.png\"\r\n                    alt=\"Card image cap\"\r\n                    class=\"image-size\"\r\n                  />\r\n                </div>\r\n                <div class=\"center-text\">\r\n                  <h3 class=\"content-card-title\">\r\n                    Amanda Ruth Garcia <br />\r\n                    <span class=\"content-card-title-description\">\r\n                      Social Media Manager\r\n                    </span>\r\n                  </h3>\r\n                </div>\r\n                <div class=\"member-bio\">\r\n                  <p class=\"card-text\">\r\n                    Amanda is a natural born influencer. She loves solving\r\n                    problems using her creativity. Amanda has been involved in\r\n                    advertising and marketing ever since her college days,\r\n                    graduating with a degree in Communication Arts. <br /><br />\r\n                    As the lead for Partbnb's social media efforts, Amanda works\r\n                    hard in creating and publishing content that would not only\r\n                    encourage future investors but also educate and help them be\r\n                    the best investors there can be.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n              <!-- <div class=\"card-footer border-0\">\r\n                <div class=\"right-text\">\r\n                  <a\r\n                    (click)=\"toggleClass($event)\"\r\n                    href=\"javascript:void(0)\"\r\n                    class=\"read-more-paragraph\"\r\n                  >\r\n                    Read More <i class=\"fas fa-plus-circle\"></i>\r\n                  </a>\r\n                </div>\r\n              </div> -->\r\n            </div>\r\n          </div>\r\n          <div class=\"col-md-4\">\r\n            <div class=\"card h-100 border-0\">\r\n              <div class=\"card-body\">\r\n                <div class=\"center-text mb-4\">\r\n                  <img\r\n                    src=\"assets/about-us/Carol@2x.png\"\r\n                    alt=\"Card image cap\"\r\n                    class=\"image-size\"\r\n                  />\r\n                </div>\r\n                <div class=\"center-text\">\r\n                  <h3 class=\"content-card-title\">\r\n                    Carolyn Ocasiones <br />\r\n                    <span class=\"content-card-title-description\">\r\n                      Customer Services Manager\r\n                    </span>\r\n                  </h3>\r\n                </div>\r\n                <div class=\"member-bio\">\r\n                  <p class=\"card-text\">\r\n                    Carolyn is a prudent process specialist and strategic\r\n                    problem solver. Identifying potential issues and risks, as\r\n                    well as, applying appropriate sustainable solutions are one\r\n                    of her valued strengths. This contributed to her various\r\n                    roles in customer service, quality, finance, administration,\r\n                    and management. <br /><br />\r\n                    As Head of Partbnb’s Customer Service, Carolyn acts as a\r\n                    liaison between investors and Customer Support team ensuring\r\n                    utmost positive experience for their investors.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n              <!-- <div class=\"card-footer border-0\">\r\n                <div class=\"right-text\">\r\n                  <a\r\n                    (click)=\"toggleClass($event)\"\r\n                    href=\"javascript:void(0)\"\r\n                    class=\"read-more-paragraph\"\r\n                  >\r\n                    Read More <i class=\"fas fa-plus-circle\"></i>\r\n                  </a>\r\n                </div>\r\n              </div> -->\r\n            </div>\r\n          </div>\r\n          <div class=\"col-md-4\">\r\n            <div class=\"card h-100 border-0\">\r\n              <div class=\"card-body\">\r\n                <div class=\"center-text mb-4\">\r\n                  <img\r\n                    src=\"assets/about-us/Mar@2x.png\"\r\n                    alt=\"Card image cap\"\r\n                    class=\"image-size\"\r\n                  />\r\n                </div>\r\n                <div class=\"center-text\">\r\n                  <h3 class=\"content-card-title\">\r\n                    Mar John Morales <br />\r\n                    <span class=\"content-card-title-description\">\r\n                      Chief Designer\r\n                    </span>\r\n                  </h3>\r\n                </div>\r\n                <div class=\"member-bio\">\r\n                  <p class=\"card-text\">\r\n                    Mar John is a design enthusiast based in the Philippines. He\r\n                    has been serving designs for numerous clients around the\r\n                    globe for 3 years. <br />\r\n                    <br />\r\n                    After graduating from a BS Information Technology course, he\r\n                    entered the world of Interface Design and has been working\r\n                    on this field since then. MJ specializes on turning raw\r\n                    ideas into usable, and device friendly designs.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n              <!-- <div class=\"card-footer border-0\">\r\n                <div class=\"right-text\">\r\n                  <a\r\n                    (click)=\"toggleClass($event)\"\r\n                    href=\"javascript:void(0)\"\r\n                    class=\"read-more-paragraph\"\r\n                  >\r\n                    Read More <i class=\"fas fa-plus-circle\"></i>\r\n                  </a>\r\n                </div>\r\n              </div> -->\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n    <hr />\r\n    <div class=\"container\">\r\n      <div class=\"center-text\">\r\n        <h3 class=\"content-title\">Advisory Board</h3>\r\n      </div>\r\n      <div class=\"content\">\r\n        <div class=\"row mb-5\">\r\n          <div class=\"col-md-4\">\r\n            <div class=\"card h-100 border-0\">\r\n              <div class=\"card-body\">\r\n                <div class=\"center-text mb-4\">\r\n                  <img\r\n                    src=\"assets/about-us/Anna Schubert @2x.png\"\r\n                    alt=\"Card image cap\"\r\n                    class=\"image-size\"\r\n                  />\r\n                </div>\r\n                <div class=\"center-text\">\r\n                  <h3 class=\"content-card-title\">\r\n                    Anna Schubert <br />\r\n                    <span class=\"content-card-title-description\"\r\n                      >Business Advisor</span\r\n                    >\r\n                  </h3>\r\n                </div>\r\n                <div class=\"member-bio\">\r\n                  <p class=\"card-text\">\r\n                    Anna is an accomplished business leader with 25 years of\r\n                    commercial experience. Over her past 20 years with Sovereign\r\n                    (and associated entities), <br /><br />\r\n                    Anna has developed a vast and deep knowledge of the\r\n                    financial services industry and the value of its\r\n                    Distribution Channels. <br /><br />\r\n                    Anna has held many senior roles during this time. In her\r\n                    current role as Head of Retail Distribution, Anna is able to\r\n                    focus her knowledge and abilities to work with our advisers\r\n                    and assist in growing their business. <br /><br />\r\n                    Anna is passionate about promoting inclusion and diversity\r\n                    across the financial services industry. Anna also\r\n                    participates as a judge in the annual Westpac Auckland\r\n                    Business awards for Best Emerging Business.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n              <!-- <div class=\"card-footer border-0\">\r\n                    <div class=\"right-text\">\r\n                      <a\r\n                        (click)=\"toggleClass($event)\"\r\n                        href=\"javascript:void(0)\"\r\n                        class=\"read-more-paragraph\"\r\n                      >\r\n                        Read More <i class=\"fas fa-plus-circle\"></i>\r\n                      </a>\r\n                    </div>\r\n                  </div> -->\r\n            </div>\r\n          </div>\r\n          <div class=\"col-md-4\">\r\n            <div class=\"card h-100 border-0\">\r\n              <div class=\"card-body\">\r\n                <div class=\"center-text mb-4\">\r\n                  <img\r\n                    src=\"assets/about-us/Richard Nacht @2x.png\"\r\n                    alt=\"Card image cap\"\r\n                    class=\"image-size\"\r\n                  />\r\n                </div>\r\n                <div class=\"center-text\">\r\n                  <h3 class=\"content-card-title\">\r\n                    Richard Nacht <br />\r\n                    <span class=\"content-card-title-description\">\r\n                      Legal Advisor\r\n                    </span>\r\n                  </h3>\r\n                </div>\r\n                <div class=\"member-bio\">\r\n                  <p class=\"card-text\">\r\n                    Richard brings a thorough understanding of the intersection\r\n                    of the law and business needs to any endeavor. He created\r\n                    six startups and has been an advisor to another thirty.\r\n                    Richard holds a J.D. and an MBA. He has a strong background\r\n                    in business modeling, strategy and tactics.\r\n                  </p>\r\n                  <br />\r\n                  <div class=\"checkList\">\r\n                    <ul>\r\n                      <li>\r\n                        Multiple startups; successfully sold Inc. 500 company.\r\n                      </li>\r\n                      <li>\r\n                        10X return delivered to publishing industry clients.\r\n                      </li>\r\n                      <li>\r\n                        Created first social network used by recruiting\r\n                        industry; Microsoft, Wachovia, Toyota clients.\r\n                      </li>\r\n                      <li>\r\n                        $1 Billion in loan portfolio the year I sold my private\r\n                        lending company.\r\n                      </li>\r\n                    </ul>\r\n                  </div>\r\n                </div>\r\n              </div>\r\n              <!-- <div class=\"card-footer border-0\">\r\n                    <div class=\"right-text\">\r\n                      <a\r\n                        (click)=\"toggleClass($event)\"\r\n                        href=\"javascript:void(0)\"\r\n                        class=\"read-more-paragraph\"\r\n                      >\r\n                        Read More <i class=\"fas fa-plus-circle\"></i>\r\n                      </a>\r\n                    </div>\r\n                  </div> -->\r\n            </div>\r\n          </div>\r\n          <div class=\"col-md-4\">\r\n            <div class=\"card h-100 border-0\">\r\n              <div class=\"card-body\">\r\n                <div class=\"center-text mb-4\">\r\n                  <img\r\n                    src=\"assets/about-us/Paul Horning @2x.png\"\r\n                    alt=\"Card image cap\"\r\n                    class=\"image-size\"\r\n                  />\r\n                </div>\r\n                <div class=\"center-text\">\r\n                  <h3 class=\"content-card-title\">\r\n                    Paul Horning <br />\r\n                    <span class=\"content-card-title-description\">\r\n                      Investor Relations Advisor\r\n                    </span>\r\n                  </h3>\r\n                </div>\r\n                <div class=\"member-bio\">\r\n                  <p class=\"card-text\">\r\n                    Paul Horning is an International Real Estate and Private\r\n                    Equity investment advisor working with Partbnb to educate US\r\n                    Accredited Investors on access to income producing and\r\n                    appreciating assets in the Caribbean. <br /><br />\r\n                    Paul is part of the team focused on scaling Partbnb’ s\r\n                    dynamic, cloud-based investor platform\r\n                  </p>\r\n                </div>\r\n              </div>\r\n              <!-- <div class=\"card-footer border-0\">\r\n                    <div class=\"right-text\">\r\n                      <a\r\n                        (click)=\"toggleClass($event)\"\r\n                        href=\"javascript:void(0)\"\r\n                        class=\"read-more-paragraph\"\r\n                      >\r\n                        Read More <i class=\"fas fa-plus-circle\"></i>\r\n                      </a>\r\n                    </div>\r\n                  </div> -->\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"row mb-5\">\r\n          <div class=\"col-md-4\">\r\n            <div class=\"card h-100 border-0\">\r\n              <div class=\"card-body\">\r\n                <div class=\"center-text mb-4\">\r\n                  <img\r\n                    src=\"assets/about-us/Brian Braggs @2x.png\"\r\n                    alt=\"Card image cap\"\r\n                    class=\"image-size\"\r\n                  />\r\n                </div>\r\n                <div class=\"center-text\">\r\n                  <h3 class=\"content-card-title\">\r\n                    Brian Braggs <br />\r\n                    <span class=\"content-card-title-description\">\r\n                      Property Advisor\r\n                    </span>\r\n                  </h3>\r\n                </div>\r\n                <div class=\"member-bio\">\r\n                  <p class=\"card-text\">\r\n                    Brian was born and raised in the Cayman Islands and became a\r\n                    real estate and investor at a very young age. Having been\r\n                    involved in the industry for over nineteen years he’s become\r\n                    well versed in the real estate market and trends in the\r\n                    Cayman Islands. <br /><br />\r\n                    As an investor and property owner, he’s gained a lot of\r\n                    experience in the rental market and property management\r\n                    aspects of Cayman real estate as well. He’s also a business\r\n                    owner and is a well respected member of the community.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n              <!-- <div class=\"card-footer border-0\">\r\n                    <div class=\"right-text\">\r\n                      <a\r\n                        (click)=\"toggleClass($event)\"\r\n                        href=\"javascript:void(0)\"\r\n                        class=\"read-more-paragraph\"\r\n                      >\r\n                        Read More <i class=\"fas fa-plus-circle\"></i>\r\n                      </a>\r\n                    </div>\r\n                  </div> -->\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</section>\r\n<!-- Content end -->\r\n"

