module.exports = "<div class=\"how-container\">\r\n  <div class=\"banner\">\r\n    <div class=\"container\">\r\n      <h3>HOW DOES IT WORK?</h3>\r\n      <p>\r\n        Becoming a part owner of an income producing property has never been\r\n        easier. <br class=\"d-none d-md-block\" />- We’ll show you how. \r\n      </p>\r\n      <button  class=\"btn btn-success\" (click)=\"toggleVideo()\">\r\n        <i class=\"fa fa-play-circle-o\" aria-hidden=\"true\"></i> Watch our video\r\n      </button>\r\n      <br class=\"d-none d-md-block\" />\r\n    </div>\r\n  </div>\r\n  \r\n  <div class=\"container\">\r\n    <div class=\"row\">\r\n      <div class=\"col-md-6\">\r\n        <h3>We buy suitable properties in the <strong>Caribbean.</strong></h3>\r\n        <p>\r\n          Our team of experts spends time researching the appropriate Caribbean\r\n          Markets to determine which properties will generate the most income\r\n          from short term rentals.\r\n        </p>\r\n        <p>\r\n          We use these findings to guide our property selection and negotiate\r\n          the best purchase price possible.\r\n        </p>\r\n      </div>\r\n      <div class=\"col-md-6\">\r\n        <img\r\n          src=\"assets/img/how-does-it-work/1.png\"\r\n          class=\"img-fluid image-size\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n    </div>\r\n\r\n    <div class=\"row\">\r\n      <div class=\"col-md-6 d-none d-md-block\">\r\n        <img\r\n          src=\"assets/img/how-does-it-work/2.png\"\r\n          class=\"img-fluid image-size\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n      <div class=\"col-md-6\">\r\n        <h3>Keylobby prepares the property for renters.</h3>\r\n        <p>\r\n          We use a Caribbean-based property management company called KeyLobby\r\n          to get the property ready for renters. They take care of all the\r\n          necessary renovations and prepare the property to be listed as a short\r\n          term vacation rental.\r\n        </p>\r\n        <p>\r\n          The team at KeyLobby posts the listing on Airbnb, VRBO, and other\r\n          popular sites to maximize exposure and ensure a high rate and\r\n          occupancy for the property.\r\n        </p>\r\n\r\n        <a\r\n          target=\"_blank\"\r\n          href=\"http://keylobby.com\"\r\n          class=\"btn btn-success button-margin\"\r\n        >\r\n          Visit KeyLobby\r\n        </a>\r\n      </div>\r\n\r\n      <div class=\"col-md-6 d-block d-md-none\">\r\n        <img\r\n          src=\"assets/img/how-does-it-work/2.png\"\r\n          class=\"img-fluid image-size\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n    </div>\r\n\r\n    <div class=\"row\">\r\n      <div class=\"col-md-6\">\r\n        <h3>The property is listed on our <strong>platform.</strong></h3>\r\n        <p>\r\n          Once a property is ready to rent, we list it on our marketplace. The\r\n          platform is designed to provide you with every detail about the\r\n          properties we offer. Read about the region, the suburb, and past\r\n          property performance.\r\n        </p>\r\n        <p>\r\n          We provide you with detailed income, expense, and yield projections\r\n          for each property. Once a listing is up and running, these projections\r\n          will be updated with actual figures.\r\n        </p>\r\n\r\n        <a routerLink=\"/app/marketplace\" class=\"btn btn-success button-margin\"\r\n          >Read more</a\r\n        >\r\n      </div>\r\n      <div class=\"col-md-6\">\r\n        <img\r\n          src=\"assets/img/how-does-it-work/3.png\"\r\n          class=\"img-fluid image-size\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n    </div>\r\n\r\n    <div class=\"row\">\r\n      <div class=\"col-md-6 d-none d-md-block\">\r\n        <img\r\n          src=\"assets/img/how-does-it-work/4.png\"\r\n          class=\"img-fluid image-size\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n      <div class=\"col-md-6\">\r\n        <h3>You receive <strong>income</strong> every month.</h3>\r\n        <p>\r\n          Each month we will compile financial accounts for the property to\r\n          assess the income / expenses.\r\n        </p>\r\n        <p>\r\n          You will receive your share of the income (after expenses have been\r\n          deducted) directly credited into your digital wallet within 15 days.\r\n          You can choose to withdraw these funds or re-invest them into other\r\n          properties.\r\n        </p>\r\n\r\n        <a routerLink=\"/app/returns\" class=\"btn btn-success button-margin\"\r\n          >Read more</a\r\n        >\r\n      </div>\r\n      <div class=\"col-md-6 d-block d-md-none\">\r\n        <img\r\n          src=\"assets/img/how-does-it-work/4.png\"\r\n          class=\"img-fluid image-size\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n    </div>\r\n\r\n    <div class=\"row\">\r\n      <div class=\"col-md-6\">\r\n        <h3><strong> Stay</strong> at the property.</h3>\r\n        <p>\r\n          As a part owner, you can book a stay at the property at a discounted\r\n          rate. This rate eliminates the usual booking fees that would be\r\n          incurred on other platforms, giving owners a discount of approximately\r\n          10% off the standard rate.\r\n        </p>\r\n        <p>\r\n          Eligible owners will also receive exclusive access to schedule their\r\n          stay before dates are released to the open market.\r\n        </p>\r\n      </div>\r\n      <div class=\"col-md-6\">\r\n        <img\r\n          src=\"assets/img/how-does-it-work/5.png\"\r\n          class=\"img-fluid image-size\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n    </div>\r\n\r\n    <div class=\"row\">\r\n      <div class=\"col-md-6 d-none d-md-block\">\r\n        <img\r\n          src=\"assets/img/how-does-it-work/6.png\"\r\n          class=\"img-fluid image-size\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n      <div class=\"col-md-6\">\r\n        <h3><strong> Buy</strong> and <strong> Sell</strong> your parts.</h3>\r\n        <p>\r\n          You can buy parts anytime from other investors (subject to\r\n          availability) or choose to list your parts for sale on the platform to\r\n          other investors at a price that you feel comfortable with. You must\r\n          hold your parts for a minimum of 6 months before you are able to list\r\n          them for re-sale.\r\n        </p>\r\n      </div>\r\n\r\n      <div class=\"col-md-6 d-block d-md-none\">\r\n        <img\r\n          src=\"assets/img/how-does-it-work/6.png\"\r\n          class=\"img-fluid image-size\"\r\n          alt=\"\"\r\n        />\r\n      </div>\r\n    </div>\r\n  </div>\r\n</div>\r\n"

