module.exports = "<!-- Header Banner -->\r\n\r\n<section id=\"headerBannerId\">\r\n  <div class=\"header-banner-container\">\r\n    <div class=\"container\">\r\n      <h3>STAYING AT THE PROPERTY</h3>\r\n      <p>\r\n        As a part owner you are welcome to book and stay at any property that\r\n        you own parts in. We are able to extend a small discount to you, and you\r\n        will get first access to book the property.\r\n      </p>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<!-- Header Banner end -->\r\n\r\n<section id=\"contentId\">\r\n  <div class=\"content-container\">\r\n    <div class=\"container\">\r\n      <div class=\"row\">\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\" style=\"padding-bottom: 0px;\">\r\n            <div class=\"card-body card-body-custom\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-save-icon></app-save-icon>\r\n                  <h3>Discounted Rate</h3>\r\n                  <p>\r\n                    As a direct booking via Key Lobby (the management company)\r\n                    you will be entitled to a discounted rate at the property.\r\n                  </p>\r\n                  <br /><br />\r\n                  <p>\r\n                    This usually equates to an approximate 10% discount, and is\r\n                    equal to the booking fees that would usually be incurred.\r\n                  </p>\r\n                  <br /><br />\r\n                  <small>\r\n                    Note - The discount applied does not affect other investors\r\n                    as the amount is based on the advertising/booking fee\r\n                    savings made from a direct booking.\r\n                  </small>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-6\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-first-access\">\r\n              <div class=\"card-body-container\" style=\"margin-bottom: 94px;\">\r\n                <div class=\"center-text\">\r\n                  <app-open-icon></app-open-icon>\r\n                  <h3>First Access</h3>\r\n                  <p>\r\n                    You will have first access to newly opened calendar months\r\n                    for the properties you own parts in. This means that you can\r\n                    book a property for a stay before it is opened up to the\r\n                    general public.\r\n                  </p>\r\n                  <br /><br />\r\n                  <p>\r\n                    We allow bookings up to 9 months in advance for public\r\n                    bookings, and 12 months in advance for part owners.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-12\">\r\n          <div class=\"content-bottom-container\">\r\n            <div class=\"row\">\r\n              <div class=\"col-md-6\">\r\n                <img\r\n                  src=\"assets/staying-at-the-property/Image@2x.png\"\r\n                  class=\"image-size\"\r\n                />\r\n              </div>\r\n              <div class=\"col-md-6\">\r\n                <div left-text>\r\n                  <h3>Already a part owner?</h3>\r\n                  <p>\r\n                    Simply log into your dashboard, choose your property and\r\n                    make a booking\r\n                  </p>\r\n                  <br />\r\n                  <a routerLink=\"/login\" class=\"btn btn-primary btn-lg\"\r\n                    >Log in now</a\r\n                  >\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<!-- <section id=\"footerBannerId\">\r\n  <div class=\"bottom-banner\">\r\n    <div class=\"container\">\r\n      <h3>How does this affect returns?</h3>\r\n      <p>\r\n        I have hinted that I would often jerk poor Queeequeg from between the\r\n        whale and the ship--where he would occasionally fall, from the incessant\r\n        rolling and swaying of both. But this was not the only jamming jeopardy\r\n        he was exposed to.\r\n      </p>\r\n      <button class=\"btn btn-primary btn-lg\">Talk to Our Team</button>\r\n    </div>\r\n  </div>\r\n</section> -->\r\n"

