module.exports = "<!-- Header Banner -->\r\n\r\n<section id=\"headerBannerId\">\r\n  <div class=\"header-banner-container\">\r\n    <div class=\"container\">\r\n      <h3>WHO DOES IT SUIT</h3>\r\n      <p>\r\n        Not every investment is suitable to every investor and you need to make sure it makes sense for you. <br>\r\n        We have prepared some of the key criteria you should consider before investing in properties offered on the Partbnb platform\r\n      </p>\r\n      <!-- <p>\r\n        We have prepared some of the key criteria you should consider before investing in properties offered on the Partbnb platform\r\n      </p> -->\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<!-- Header Banner end -->\r\n\r\n<section id=\"contentId\">\r\n  <div class=\"content-container\">\r\n    <div class=\"container\">\r\n      <div class=\"row\">\r\n        <div class=\"col-md-4\">\r\n          <div class=\"card\">  \r\n            <div class=\"card-body\">\r\n              <div class=\"card-body-container margin-bottom-small\">\r\n                <div class=\"center-text\">\r\n                  <app-investor-icon></app-investor-icon>\r\n                  <!-- <h3>Accredited Investor</h3> -->\r\n                  <!-- <p>\r\n                    Our offer is currently only available to Accredited Investors.<br />\r\n                    This is a person with either a net worth of $1M (excluding their main residence) or income of $200k p/a (single) / $300k p/a (Joint)\r\n                  </p> -->\r\n                  <h3>All Investors</h3>\r\n                  <p class=\"margin-bottom\">\r\n                      Our current offers are only available to Accredited Investors, however offers will be available to All Investors in September 2019 (subject to regulatory approval)<br /><br />\r\n                      <small>Accredited Investors are persons with either a net worth of $1M (excluding their main residence) or income of $200k p/a (single) / $300k p/a (Joint)</small>\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-4\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-body-customs-card-two\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-yields-icon></app-yields-icon>\r\n                  <h3>Short Term Vacation Rentals</h3>\r\n                  <p>\r\n                    The properties that we offer on the platform are all rented out as short term vacation rentals. This means that occupancy and rates can fluctuate, and often there are low/high seasons. Income can rise or fall at different times of the year.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-4\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-body-customs-card-three\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-long-term-icon></app-long-term-icon>\r\n                  <h3>Long Term Horizon</h3>\r\n                  <p>\r\n                    Real estate values have traditionally risen over time worldwide. However these gains are usually measured over years, and you should expect shorter term rises & falls depending on the local and global market.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-4\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-diversify-icon></app-diversify-icon>\r\n                  <h3>Investment Diversification</h3>\r\n                  <p>\r\n                    Purchasing smaller parts of a larger number of properties helps to achieve diversification. This can reduce your risk of a single event impacting the performance of your overall portfolio.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-4\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-body-customs-card-five\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-staying-icon></app-staying-icon>\r\n                  <h3>Stay at Your Property</h3>\r\n                  <p>\r\n                    All part holders are entitled to early access and preferred rates to any property they hold parts in. Note - the discount applied does not affect other investors as the discount is based on the advertising / booking fee savings made from a direct booking.\r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n        <div class=\"col-md-4\">\r\n          <div class=\"card\">\r\n            <div class=\"card-body card-body-customs-card-six\">\r\n              <div class=\"card-body-container\">\r\n                <div class=\"center-text\">\r\n                  <app-ownership-icon></app-ownership-icon>\r\n                  <h3>No Hassle Ownership</h3>\r\n                  <p>\r\n                    The management of the property, accounts, bookings, maintenance etc is 100% managed by KeyLobby - this means that you don’t need to worry. \r\n                  </p>\r\n                </div>\r\n              </div>\r\n            </div>\r\n          </div>\r\n        </div>\r\n      </div>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<!-- <section id=\"footerBannerId\">\r\n  <div class=\"bottom-banner\">\r\n    <div class=\"container\">\r\n      <h3>Still not sure if this type of investment suits you?</h3>\r\n      <p>\r\n        Let us know what you need. Our team of experts are always on the go\r\n        helping you out!\r\n      </p>\r\n      <button class=\"btn btn-primary btn-lg\">Talk to Our Team</button>\r\n    </div>\r\n  </div>\r\n</section> -->\r\n"

